Kai taip karšta, norisi gaivių, lengvų pusryčių, kurie neatimtų laiko gaminimui, o skrandis jaustųsi ilgai sotus ir neperkrautas. Tokiais pusryčiais gali tapti begliutenės pilno grūdo košės, praturtintos įvairiais riešutukais, sėklomis, geraisiais riebalais ir, žinoma, uogomis. Pusryčiai po pušelėmis – 2 porcijoms reikės: - 100 g ekologiškų soros kruopų; - 60 g baltos bolivinės balandos sėklų; - 450 g vandens; - 2 v.š. kokoso drožlių; - Žiupsnis druskos; - 1 a.š. sviesto; - 2 v.š. MCT aliejaus; 
..........
 vandeniu. Palikti per naktį brinkti. Ryte nupilti vandenį, suberti kokoso drožles, įpilti nurodytą kiekį vandens, druskos ir užvirti. Po 2-3 minučių išjungti ir uždengti puodą rankšluosčiu. Košę šiltai užkloti ir palikti brinkti 20min. - Patiekiant įmaišyti sviesto, aliejaus. Dubenėlyje pabarstyti košę riešutais ir uogomis. Norint saldžiau, rekomenduoju pašlakstyti kerobos sirupu arba Syrup Gold – eritritolio skysta versija. Skanaus Jums linki, Kviečiame prisijungti prie kartu tobulėjančios ben
